<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Draw Connect</title>
</head>

<body>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');

        * {
            margin: 0;
            padding: 0;
            font-family: "Poppins";
        }

        body {
            background-color: aliceblue;
        }

        h1 {
            position: absolute;
            top: 40%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-family: "Poppins";
            width: 100%;
            text-align: center;
        }

        #code_id {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            border: none;
            width: 8%;
            height: 6%;
            border-radius: 10px;
            font-family: "Poppins";
            border: 1px solid blue;
            text-align: center;
            font-size: 20px;
        }

        #code_id:focus {
            outline: none;
        }

        #submit {
            position: absolute;
            top: 59%;
            left: 50%;
            transform: translate(-50%, -50%);
            border: none;
            width: 15%;
            height: 6%;
            border-radius: 10px;
            font-family: "Poppins";
            border: 1px solid blue;
            text-align: center;
            font-size: 20px;
            background-color: white;
            cursor: pointer;
            font-weight: 600;
        }

        #submit:focus {
            outline: none;
        }

        noscript h1 {
            top: 50%
        }
    </style>
    <noscript>
        <h1>Please enable JavaScript</h1>
    </noscript>
    <h1>Enter the code indicated on the phone</h1>
    <input type="text" name="code" id="code_id" placeholder="XXXXX">
    <button id="submit">
        <p>GO</p>
    </button>
